(13, 1, '2023-11-03 17:05:48', '0000-00-00 00:00:00', '<!-- wp:paragraph -->\n<p><b>This is a sample page.</b></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<h3>Overview</h3>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Our refund and returns policy lasts 30 days. If 30 days have passed since your purchase, we canâ€™t offer you a full refund or exchange.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To be eligible for a return, your item must be unused and in the same condition that you received it. It must also be in the original packaging.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Several types of goods are exempt from being returned. Perishable goods such as food, flowers, newspapers or magazines cannot be returned. We also do not accept products that are intimate or sanitary goods, hazardous materials, or flammable liquids or gases.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Additional non-returnable items:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul>\n<li>Gift cards</li>\n<li>Downloadable software products</li>\n<li>Some health and personal care items</li>\n</ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>To complete your return, we require a receipt or proof of purchase.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Please do not send your purchase back to the manufacturer.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>There are certain situations where only partial refunds are granted:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul>\n<li>Book with obvious signs of use</li>\n<li>CD, DVD, VHS tape, software, video game, cassette tape, or vinyl record that has been opened.</li>\n<li>Any item not in its original condition, is damaged or missing parts for reasons not due to our error.</li>\n<li>Any item that is returned more than 30 days after delivery</li>\n</ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<h2>Refunds</h2>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Once your return is received and inspected, we will send you an email to notify you that we have received your returned item. We will also notify you of the approval or rejection of your refund.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you are approved, then your refund will be processed, and a credit will automatically be applied to your credit card or original method of payment, within a certain amount of days.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<b>Late or missing refunds</b>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you havenâ€™t received a refund yet, first check your bank account again.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Then contact your credit card company, it may take some time before your refund is officially posted.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Next contact your bank. There is often some processing time before a refund is posted.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If youâ€™ve done all of this and you still have not received your refund yet, please contact us at {email address}.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<b>Sale items</b>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Only regular priced items may be refunded. Sale items cannot be refunded.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<h2>Exchanges</h2>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We only replace items if they are defective or damaged. If you need to exchange it for the same item, send us an email at {email address} and send your item to: {physical address}.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<h2>Gifts</h2>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If the item was marked as a gift when purchased and shipped directly to you, youâ€™ll receive a gift credit for the value of your return. Once the returned item is received, a gift certificate will be mailed to you.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If the item wasnâ€™t marked as a gift when purchased, or the gift giver had the order shipped to themselves to give to you later, we will send a refund to the gift giver and they will find out about your return.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<h2>Shipping returns</h2>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To return your product, you should mail your product to: {physical address}.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You will be responsible for paying for your own shipping costs for returning your item. Shipping costs are non-refundable. If you receive a refund, the cost of return shipping will be deducted from your refund.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Depending on where you live, the time it may take for your exchanged product to reach you may vary.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you are returning more expensive items, you may consider using a trackable shipping service or purchasing shipping insurance. We donâ€™t guarantee that we will receive your returned item.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<h2>Need help?</h2>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Contact us at {email} for questions related to refunds and returns.</p>\n<!-- /wp:paragraph -->', 'Refund and Returns Policy', '', 'draft', 'closed', 'closed', '', 'refund_returns', '', '', '2023-11-03 17:05:48', '0000-00-00 00:00:00', '', 0, 'http://rsclassicfb.com/?page_id=13', 0, 'page', '', 0),
(14, 0, '2023-11-03 17:05:50', '2023-11-03 17:05:50', '<!-- wp:group {\"layout\":{\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group\">\n	<!-- wp:group {\"align\":\"wide\",\"style\":{\"spacing\":{\"padding\":{\"bottom\":\"var:preset|spacing|40\"}}},\"layout\":{\"type\":\"flex\",\"justifyContent\":\"space-between\"}} -->\n	<div class=\"wp-block-group alignwide\" style=\"padding-bottom:var(--wp--preset--spacing--40)\">\n		<!-- wp:site-title {\"level\":0} /-->\n		<!-- wp:navigation {\"layout\":{\"type\":\"flex\",\"setCascadingProperties\":true,\"justifyContent\":\"right\"}} /-->\n	</div>\n	<!-- /wp:group -->\n</div>\n<!-- /wp:group -->\n\n			<!-- wp:group {\"layout\":{\"inherit\":true}} -->\n			<div class=\"wp-block-group\">\n				<!-- wp:heading {\"level\":1} -->\n				<h1 class=\"wp-block-heading\">Cart</h1>\n				<!-- /wp:heading -->\n				<!-- wp:shortcode -->[woocommerce_cart]<!-- /wp:shortcode -->\n			</div>\n			<!-- /wp:group -->\n		<!-- wp:pattern {\"slug\":\"twentytwentythree/footer-default\"} /-->\n', '', '', 'publish', 'closed', 'closed', '', 'cart', '', '', '2023-11-03 17:05:50', '2023-11-03 17:05:50', '', 0, 'http://rsclassicfb.com/?p=14', 0, 'wp_template', '', 0),
(15, 0, '2023-11-03 17:05:50', '2023-11-03 17:05:50', '<!-- wp:group {\"layout\":{\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group\">\n	<!-- wp:group {\"align\":\"wide\",\"style\":{\"spacing\":{\"padding\":{\"bottom\":\"var:preset|spacing|40\"}}},\"layout\":{\"type\":\"flex\",\"justifyContent\":\"space-between\"}} -->\n	<div class=\"wp-block-group alignwide\" style=\"padding-bottom:var(--wp--preset--spacing--40)\">\n		<!-- wp:site-title {\"level\":0} /-->\n		<!-- wp:navigation {\"layout\":{\"type\":\"flex\",\"setCascadingProperties\":true,\"justifyContent\":\"right\"}} /-->\n	</div>\n	<!-- /wp:group -->\n</div>\n<!-- /wp:group -->\n\n			<!-- wp:group {\"layout\":{\"inherit\":true}} -->\n			<div class=\"wp-block-group\">\n				<!-- wp:heading {\"level\":1} -->\n				<h1 class=\"wp-block-heading\">Checkout</h1>\n				<!-- /wp:heading -->\n				<!-- wp:shortcode -->[woocommerce_checkout]<!-- /wp:shortcode -->\n			</div>\n			<!-- /wp:group -->\n		<!-- wp:pattern {\"slug\":\"twentytwentythree/footer-default\"} /-->\n', '', '', 'publish', 'closed', 'closed', '', 'checkout', '', '', '2023-11-03 17:05:50', '2023-11-03 17:05:50', '', 0, 'http://rsclassicfb.com/?p=15', 0, 'wp_template', '', 0),
(16, 1, '2023-11-03 17:07:14', '2023-11-03 17:07:14', '{\"id\":16,\"field_id\":5,\"fields\":{\"0\":{\"id\":\"0\",\"type\":\"name\",\"label\":\"Name\",\"format\":\"simple\",\"description\":\"\",\"required\":\"1\",\"size\":\"large\",\"simple_placeholder\":\"Your Name\",\"simple_default\":\"\",\"first_placeholder\":\"\",\"first_default\":\"\",\"middle_placeholder\":\"\",\"middle_default\":\"\",\"last_placeholder\":\"\",\"last_default\":\"\",\"label_hide\":\"1\",\"css\":\"wpforms-one-half wpforms-first\"},\"3\":{\"id\":\"3\",\"type\":\"email\",\"label\":\"Email\",\"description\":\"\",\"required\":\"1\",\"size\":\"large\",\"placeholder\":\"Your Email\",\"confirmation_placeholder\":\"\",\"label_hide\":\"1\",\"default_value\":\"\",\"css\":\"wpforms-one-half\"},\"4\":{\"id\":\"4\",\"type\":\"text\",\"label\":\"Subject\",\"description\":\"\",\"size\":\"large\",\"placeholder\":\"Subject\",\"label_hide\":\"1\",\"default_value\":\"\",\"css\":\"\",\"input_mask\":\"\"},\"2\":{\"id\":\"2\",\"type\":\"textarea\",\"label\":\"Message\",\"description\":\"\",\"required\":\"1\",\"size\":\"medium\",\"placeholder\":\"Your Message\",\"label_hide\":\"1\",\"css\":\"\"}},\"settings\":{\"form_title\":\"Hestia\",\"form_desc\":\"\",\"form_class\":\"\",\"submit_text\":\"Send message\",\"submit_text_processing\":\"Sending...\",\"submit_class\":\"\",\"notification_enable\":\"1\",\"notifications\":{\"1\":{\"email\":\"{admin_email}\",\"subject\":\"New Entry: Zerif\",\"sender_name\":\"{field_id=\\\"0\\\"}\",\"sender_address\":\"{admin_email}\",\"replyto\":\"{field_id=\\\"1\\\"}\",\"message\":\"{all_fields}\"}},\"confirmation_type\":\"message\",\"confirmation_message\":\"Thanks for contacting us! We will be in touch with you shortly.\",\"confirmation_message_scroll\":\"1\",\"confirmation_page\":\"9\",\"confirmation_redirect\":\"\"},\"meta\":{\"template\":\"contact\"}}', 'Hestia', '', 'publish', 'closed', 'closed', '', 'hestia', '', '', '2023-11-03 17:07:14', '2023-11-03 17:07:14', '', 0, 'https://rsclassicfb.com/?p=16', 0, 'wpforms', '', 0),
(17, 1, '2023-11-03 17:07:41', '2023-11-03 17:07:41', '<p>In a world filled with noise and distractions, there is something truly magical about embracing the pure and authentic. It is about finding solace in simplicity and reconnecting with the essence of life.</p><p>Living in a fast-paced society, we often get caught up in the pursuit of material possessions, societal expectations, and the constant need for validation. We forget to appreciate the beauty in the little things and the power of authenticity.</p><p>Authenticity is about being true to oneself, embracing our flaws, and celebrating our unique qualities. It is about letting go of the masks we wear and allowing our true selves to shine through.</p><p>When we live authentically, we create a space for genuine connections and meaningful relationships. We attract people who appreciate us for who we truly are, and we inspire others to do the same.</p><p>Embracing authenticity also means embracing imperfection. We live in a world that often portrays perfection as the ultimate goal, but in reality, perfection is an illusion. It is our imperfections that make us human and relatable.</p><p>By embracing our imperfections, we learn to accept ourselves unconditionally and to extend that acceptance to others. We become more compassionate and understanding, and we foster an environment of inclusivity and empathy.</p><p>Living a pure and authentic life also means living in alignment with our values and beliefs. It means making choices that resonate with our true selves and staying true to our principles, even when faced with challenges or temptations.</p><p>When we live in alignment with our values, we experience a sense of inner peace and fulfillment. We no longer feel the need to conform to societal expectations or to seek validation from others. Instead, we find contentment in living a life that is true to ourselves.</p><p>Embracing the pure and authentic also extends to the choices we make in our daily lives. It means nourishing our bodies with wholesome and natural foods, taking care of our physical and mental well-being, and surrounding ourselves with positive influences.</p><p>When we choose to live a pure and authentic life, we create a ripple effect that extends beyond ourselves. Our choices inspire others to do the same, and together, we can create a world that values authenticity, simplicity, and genuine connections.</p><p>So, let us embrace the pure and authentic. Let us strip away the layers of pretense and rediscover the beauty in simplicity. Let us live in alignment with our values and celebrate our imperfections. And let us create a world where authenticity is cherished, and genuine connections are valued above all.</p>', 'Pure and Authentic: Embracing the Essence of Life', '', 'publish', 'open', 'open', '', 'pure-and-authentic-embracing-the-essence-of-life', '', '', '2023-11-03 17:07:41', '2023-11-03 17:07:41', '', 0, 'http://rsclassicfb.com/?p=17', 0, 'post', '', 0),
(18, 1, '2023-11-03 17:07:43', '2023-11-03 17:07:43', '<p>Living a pure and authentic life is a choice that many people strive for. It is about being true to yourself, embracing simplicity, and living in alignment with your values and beliefs. In a world filled with distractions and superficiality, it can be challenging to stay true to who you are and live authentically. However, the rewards of living a pure and authentic life are immeasurable.</p><p>When we talk about living a pure life, it means living with integrity and honesty. It means being genuine and sincere in your thoughts, words, and actions. Living authentically means not pretending to be someone you\'re not or conforming to societal expectations. It means being true to your own unique self and expressing your individuality.</p><p>Living a pure and authentic life starts with self-awareness. Take the time to reflect on your values, passions, and purpose. What truly matters to you? What brings you joy and fulfillment? Once you have a clear understanding of who you are and what you stand for, it becomes easier to make choices that align with your authentic self.</p><p>One of the key aspects of living a pure and authentic life is embracing simplicity. In a world that glorifies busyness and material possessions, simplicity can be a revolutionary act. It means decluttering your physical space, simplifying your schedule, and prioritizing what truly matters. By letting go of the unnecessary, you create space for what brings you joy and meaning.</p><p>Living a pure and authentic life also involves cultivating healthy relationships. Surround yourself with people who support and inspire you to be your best self. Let go of toxic relationships that drain your energy and hinder your growth. Authentic connections are built on trust, respect, and mutual understanding.</p><p>Another important aspect of living a pure and authentic life is practicing self-care. Take care of your physical, mental, and emotional well-being. Prioritize activities that nourish your body, mind, and soul. This could include exercise, meditation, spending time in nature, or pursuing hobbies that bring you joy.</p><p>Living a pure and authentic life is not always easy. It requires courage, self-reflection, and a willingness to let go of societal expectations. However, the benefits are worth it. When you live authentically, you attract opportunities and experiences that are in alignment with your true self. You experience a sense of inner peace and fulfillment that cannot be achieved through external validation.</p>', 'The Essence of Pure and Authentic Living', '', 'publish', 'open', 'open', '', 'the-essence-of-pure-and-authentic-living', '', '', '2023-11-03 17:07:43', '2023-11-03 17:07:43', '', 0, 'http://rsclassicfb.com/?p=18', 0, 'post', '', 0);

