(29, 'woopay-beta-merchantrecruitment-04MAY23', 'info', 'en_US', 'Increase conversions with WooPay â€” our fastest checkout yet', 'WooPay, a new express checkout feature built into WooCommerce Payments, is now available â€”and weâ€™re inviting you to be one of the first to try it. \r\n<br><br>\r\nBoost conversions by offering your customers a simple, secure way to pay with a single click.\r\n<br><br>\r\nGet started in seconds.', '{}', 'pending', 'woocommerce.com', '2023-11-03 17:05:51', NULL, 0, 'plain', '', 0, 0, 'info'),
